import React from 'react'
import image from './Logos/1.png'
import styled from 'styled-components'
const Toolbar = styled.header`
h1{

    color:blac !important ;
   position:absolute;
   opacity: 10;
}
.img1{
    background-color:#F56753;
}
.main{
  background-color:#F56753;
}
.op{
    height:462px;
    background-image:url(${image});
    background-repeat:no-repeat;
    background-size:cover;
    background-position:center;
    opacity:0.4
 
}

`
function FooterTop() {
    return (
        <>
            <Toolbar>
                <div className="fluid-container">
                    <div className="main">

                        <div className="op">
                            <h1 className="card-ti" ><strong>2021 AAZADY CAMPERVAN EVENT</strong></h1>
                        </div>


                    </div>
                    <div className="img1">

                    </div>

                </div>
                {/* <div className="card text-white"  >

                    <img src={image} className="card-img" alt="car" />


                    <div className="card-img-overlay" >
                        <h1 className="card-ti" >2021 AAZADY CAMPERVAN EVENT</h1>
                    </div>
                </div> */}
            </Toolbar>

        </>
    )
}

export default FooterTop
